import { useState } from 'react';
import { FaBars } from 'react-icons/fa';

const NavBar = () => {
  const [showMenu, setShowMenu] = useState(false);
  return (
    <nav>
      <ul className="flex bg-black h-20 text-white">
        <li className="flex-1 text-3xl text-center pt-4 pl-4">U Dance</li>
        <li className="text-3xl pt-5 pr-4" onClick={() => setShowMenu(!showMenu)}><FaBars /></li>
      </ul>
      <ul className="text-center">
        <li className="p-5 bg-black text-white">Home</li>
        <li className="p-5 bg-black text-white">Course</li>
        <li className="p-5 bg-black text-white">Log in</li>
        <li className="p-5 bg-black text-white">Sign up</li>
      </ul>
    </nav>
  );
};

export default NavBar;
